  const[question, setQuestion] = useState(data)
  return (
    <div className="App">
      <h3>Accordion Projects</h3>
      {
        question.map((question) => {

          return (
            <Question key={question.id} {...question} />

          )
        })
      }
    </div>
  );
}

export default App;
